import React, { useState, useEffect } from "react";

// Base API URLs
const JAVA_API = "http://localhost:9090/maven-archetype-webapp/hello";
const NODE_API = "http://localhost:3000";

function App() {
  const [message, setMessage] = useState("");
  const [users, setUsers] = useState([]);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [status, setStatus] = useState("");

  // ðŸŸ¢ Fetch data from Java backend
  const fetchJavaMessage = async () => {
    try {
      const res = await fetch(JAVA_API);
      const text = await res.text();
      setMessage(text);
    } catch (err) {
      console.error("Error fetching Java message:", err);
      setMessage("âš ï¸ Error connecting to Java backend!");
    }
  };

  // ðŸŸ¢ Fetch users from Node backend
  const fetchUsers = async () => {
    try {
      const res = await fetch(`${NODE_API}/users`);
      const data = await res.json();
      setUsers(data);
    } catch (err) {
      console.error("Error fetching users:", err);
      setUsers([]);
    }
  };

  // ðŸŸ¢ Add new user
  const addUser = async (e) => {
    e.preventDefault();
    if (!name || !email) {
      setStatus("âš ï¸ Please fill all fields!");
      return;
    }

    try {
      const res = await fetch(`${NODE_API}/add-user`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ name, email }),
      });

      if (res.ok) {
        setStatus("âœ… User added successfully!");
        setName("");
        setEmail("");
        fetchUsers(); // Refresh list
      } else {
        setStatus("âŒ Failed to add user!");
      }
    } catch (err) {
      console.error("Error adding user:", err);
      setStatus("âŒ Error connecting to backend!");
    }
  };

  // ðŸ—‘ Delete user by ID
  const deleteUser = async (id) => {
    const confirmDelete = window.confirm("Are you sure you want to delete this user?");
    if (!confirmDelete) return;

    try {
      const res = await fetch(`${NODE_API}/delete-user/${id}`, {
        method: "DELETE",
      });

      if (res.ok) {
        setStatus("ðŸ—‘ User deleted successfully!");
        fetchUsers();
      } else {
        setStatus("âŒ Failed to delete user!");
      }
    } catch (err) {
      console.error("Error deleting user:", err);
      setStatus("âŒ Error connecting to backend!");
    }
  };

  // Load on start
  useEffect(() => {
    fetchJavaMessage();
    fetchUsers();
  }, []);

  return (
    <div style={{ padding: "30px", fontFamily: "Arial", textAlign: "center" }}>
      <h2>ðŸš€ React + Node + Java Integration</h2>

      <h3>âœ… Data from Java Backend:</h3>
      <p>{message || "Loading message from Java Servlet..."}</p>

      <h3>âœ… Users from Node.js + MySQL:</h3>
      {users.length > 0 ? (
        users.map((user, index) => (
          <p key={index}>
            {user.name} - {user.email}
            <button
              onClick={() => deleteUser(user.id)}
              style={{
                marginLeft: "10px",
                backgroundColor: "red",
                color: "white",
                border: "none",
                padding: "3px 8px",
                borderRadius: "5px",
                cursor: "pointer",
              }}
            >
              Delete
            </button>
          </p>
        ))
      ) : (
        <p>No users or still loading...</p>
      )}

      <h3>âž• Add New User</h3>
      <form onSubmit={addUser}>
        <input
          type="text"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          style={{ margin: "5px", padding: "5px" }}
        />
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          style={{ margin: "5px", padding: "5px" }}
        />
        <button
          type="submit"
          style={{
            backgroundColor: "green",
            color: "white",
            border: "none",
            padding: "5px 10px",
            borderRadius: "5px",
            cursor: "pointer",
          }}
        >
          Add User
        </button>
      </form>

      <p style={{ color: "blue", marginTop: "15px" }}>{status}</p>
    </div>
  );
}

export default App;
